import { GET_ERRORS} from './types';
import axios from 'axios';

export const addNode = (data) => dispatch => {
    axios
        .post('/api/nodes/add', data )
        
        .catch(err => 
            dispatch({
                type: GET_ERRORS,
                payload: err.response.data
            })
        );
};
